The film is about a cat and mouse game between a serial killer and a brave police officer. The standout thing in the whole film is the outstanding cinematography by #PGVinda. The colors used in the film and the framing of every shot looks brilliant on screen. It surely would have been a visual feast on the big screen. The production values are top-notch. Director #MohanakrishnaIndrganthi has proved himself that he can direct an out and out commercial film. 

The first half is nicely set up with superb introduction scenes, slo-mo shots, and a decent interval twist. But it's the second half where the screenplay looked very predictable. The film could not hold the attention of the viewer all though all the characters were performing well. Nani's comedy track didn't work at all. The twists and clues in the film aren't gripping. The back story is quite routine and the reason for which Nani turns into a serial killer is not convincing. The climax which needed a bang, dint have any effect.

#Nani looks pretty good with his negative role and uses his unique dialogue delivery perfectly to showcase the swag but there isn't a sense of fulfillment with his character. #SudheerBabu looked perfect and fit in his cop’s role. Watch out for his introduction sequence. #NivethaThomas looked decent while #AditiRao does justice to her role in the second half. 

#AmitTrivedi’s music is good. Except for the last item song, rest all songs strike a chord. #Thaman’s background score looks similar to the score of Tamil film #Ratsasan. The edit by Marthand Venkatesh was fine. Special mention to the action choreography which looked super stylish on-screen. 

A predictable and half-backed action thriller.
PS: With super stylish visuals!
Available on #AmazonPrime

